/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER vender BEFORE INSERT ON detallefactura FOR EACH ROW































BEGIN































	DECLARE moneda VARCHAR(20);































	if (SELECT stock FROM productos WHERE id = NEW.producto) >= NEW.cantidadProducto then 































		UPDATE productos SET stock=stock-NEW.cantidadProducto WHERE id = NEW.producto;































		SET moneda = (SELECT monedaVenta FROM productos WHERE id = NEW.producto);































		if moneda = 'Dolar' then































			UPDATE facturas SET totalDolares=totalDolares+NEW.totalVenta WHERE id = NEW.factura;































		ELSE 































			UPDATE facturas SET totalCordobas=totalCordobas+NEW.totalVenta WHERE id = NEW.factura;































		END if;































	ELSE 































		SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'No hay suficiente producto en stock.';































	END if;































