CREATE DEFINER=`root`@`localhost` PROCEDURE `utilidades`(IN fechaInicio VARCHAR(20), IN fechaFinal VARCHAR(20), IN precioDolar DECIMAL)
BEGIN















   DECLARE ventas DECIMAL;















   DECLARE cordobas DECIMAL;















   DECLARE dolar DECIMAL;















   DECLARE utilidad DECIMAL;































   SET ventas = (SELECT SUM(totalFactura) FROM facturas WHERE fecha BETWEEN fechaInicio AND fechaFinal);































   SET cordobas = (select sum(df.cantidadProducto*p.precioCompra) as total from detalleFactura as df















                   inner join facturas as f on(f.id=df.factura) inner join productos as p on(p.id=df.producto)















                   where f.fecha BETWEEN fechaInicio AND fechaFinal AND p.monedaCompra = 'Córdobas');































   SET dolar = (SELECT SUM(ROUND((df.cantidadProducto*p.precioCompra)*precioDolar,2)) AS total FROM detalleFactura AS df















                INNER JOIN facturas AS f ON(f.id=df.factura) INNER JOIN productos AS p ON(p.id=df.producto)















                WHERE f.fecha BETWEEN fechaInicio AND fechaFinal AND p.monedaCompra='Dolar');































   SET utilidad = ventas - (cordobas + dolar);































   SELECT ventas, cordobas, dolar;































  END ;;
